        <div>
            <p id="homepage-title">Car Haven</p>
            <p id="homepage-subtitle">"Modern Car Market"</p>
            <h1 className="text-2xl font-bold underline">
      Hello world!
    </h1>
        </div>
    )
};

// Export
export default HomePage;
